import React from 'react';
import './App.css';
import Nav from './components/navBar/navbar.js';
import shop from './components/Shop/shop.js';
import {BrowRouter as Router, Route,Routes} from 'react-router-dom'

function app() {

    return (
      <div>

       <Router>
        <Nav />
          <Routes>
            <Route path="/shop" component={shop}/>
          </Routes>
        </Router>

      </div>
    );
}


export default app;
